import './ExpensesList.css';

import ExpenseItem from './ExpenseItem';

export default function ExpensesList({
  items,
}) {
  if (items.length === 0) {
    return (
      <h2 className='expenses-list__fallback'>
        Found no expenses.
      </h2>
    )
  }

  return (
    <ul className='expenses-list'>
      {items.map((expense) => (
        <ExpenseItem 
          key={expense.id}
          title={expense.title} 
          amount={expense.amount}
          date={expense}
        />
      ))}
    </ul>
  )
}
